body:
Jean-Pierre,

I made numerous modifications to seacarb v3.0.3 so that in our comparison seacarb results would agree with other critical packages (e.g., CO2SYS) in the comparison.  One of these changes (replacing use of incorrect ionic strength 'ION' with correct version 'iom0' in Kf.R) did not seem to get carried over from what I sent you many months ago. Perhaps it was forgotten because we were not yet following standard github practice with pull requests etc.

More generally, errors in carb.R, K1.R, and K2.R caused significant discrepancies. Those errors probably originated with major changes made for seacarb 3.0.   It took some time to find and correct the problems, but now results are right on target: they agree with CO2SYS, mocsy, etc. Here are a few general details about the major changes:

1) theta.R - new routine to compute potential temperature (relies on 'swTheta' from 'oce' package);
2) rho.R - convert input temperature T (ITS 90) to T (IPTS 68) & then compute density, as intended;
3) global change - use more accurate Ft equation and less ambiguous equation for St (at.R, Ks.R, Pcorrect.R, kconv.R, pHconv.R, buffer.R, buffesm.R, carb.R, ...);
4) Kb. R - refined pH scale conversion;
5) K1.R, K2.R - corrected errors in pH scale conversion; and
6) carb.R - corrected errors in pH scale conversion & fCO2 -> pCO2 conversion
